import React from "react";
import { TextField } from "@material-ui/core";
import style from '../../assets/css/App.styles'


const CustomTextField :  React.FC<{}> = () => {
    const classes = style();
    return (
        <div >
                 <TextField id="outlined-basic" label="Outlined" variant="outlined"  className={classes.textSearchGeneric} style={{

          width: "100%",

          padding:'5px',
          marginLeft:'3%',
          marginBottom: "3%",


        }}/>
        </div>
    );


}

export default CustomTextField;
